import { useNavigation } from '@react-navigation/core'
import { StyleSheet, Text, View, KeyboardAvoidingView, TextInput, TouchableOpacity, Alert } from 'react-native'
import React, {useState} from 'react'
import { fireAuth, db, colRef } from '../firebase'
import { createUserWithEmailAndPassword, signInWithEmailAndPassword } from 'firebase/auth';
import { addDoc, collection, onSnapshot, query, where, getDocs} from "firebase/firestore";
import One from "../assets/one.svg";

let userRefid;
const LoginScreen = () => { 
	const [email, setEmail] = useState('')
	const [password, setPassword] = useState('')
    const navigation = useNavigation();
    
    const createUserProfile = async (userAuth) => {
        if (!userAuth) return;
        const createdAt = new Date();

        const userRef = await addDoc(collection(db, "users"), {
            userEmail: email,
            createdAt: createdAt,
            name: null
        }).then((userRef) => {
        userRefid = userRef.id;
        console.log("idzz",userRefid)})
        navigation.replace("Details")
       
    }

	const handleSignUp = () => {
		createUserWithEmailAndPassword(fireAuth, email, password)
		.then(userCredentials => {
			const user = userCredentials.user;
			console.log("Successfully signed up: ", user.email);
            createUserProfile(userCredentials);
            alert("Successful");
            
		})
		.catch(error => alert(error.message))
	}

    const getQuery = async (q) => {
        const querySnapshot = await getDocs(q);
        querySnapshot.forEach((doc) => {
            userRefid = doc.data().id;
          });
        navigation.replace("Welcome Home")
    }

    const handleLogin = () => {
        signInWithEmailAndPassword(fireAuth, email, password)
        .then(userCredentials => {
			const user = userCredentials.user;
			console.log("Logged in into: ", user.email);
            alert("Successful")
            const q = query(colRef, where("userEmail", "==", user.email))
            getQuery(q);
        })
		.catch(error => alert(error.message))
    }

	return (
    <KeyboardAvoidingView
        style={styles.container}
        behavior="padding">
        <One style={styles.svg} />
        <View style={styles.titleContainer}>
            <Text style={styles.title}> CardioHARDio</Text>
        </View>
        <View style={styles.inputContainer}>
            <TextInput
                placeholder = "Email"
                value = { email }
                onChangeText = {text => setEmail(text.trim())}
                style= {styles.input}
            />
        
            <TextInput
                placeholder = "Password"
                value = { password }
                onChangeText = {text => setPassword(text)}
                style= {styles.input}
                secureTextEntry
            />        
        </View>

        <View style={styles.buttonContainer}>
            <TouchableOpacity
                onPress= {handleLogin}
                style= {styles.button}
            >
                <Text style={styles.buttonText}>Login</Text>
            </TouchableOpacity>
            <TouchableOpacity
                onPress= {handleSignUp}
                style= {[styles.button, styles.buttonOutline]}
            >
                <Text style={styles.buttonOutlineText}>Register</Text>
            </TouchableOpacity>
        </View>
   </KeyboardAvoidingView>
  )
}

export {userRefid};
export default LoginScreen

const styles = StyleSheet.create({
    svg: {
        height: '250',
        width: '300',
        borderRadius: '100%',
        borderWidth: 1,
        borderColor: 'white',
        marginTop: -70,
    },
    titleContainer: {
        paddingBottom: 10,
        paddingTop: 10,
    },
    title: {
        fontFamily: 'PassionOne_700Bold',
        letterSpacing: 1,
        fontSize: 50,
    },
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: 'white',
        margin: 0,
    },
    inputContainer: {
        width: '80%',
        marginTop: 0,
    },
    input: {
        paddingHorizontal: 15,
        paddingVertical: 15,
        borderRadius: 10,
        marginTop: '5%',
        backgroundColor: '#F5F5F5',
    },
    buttonContainer: {
        width: '60%',
        justifyContent: 'center',
        alignItems: 'center',
        marginTop: 40,
    },
    button: {
        backgroundColor: '#212A3E',
        width: '100%',
        marginBottom: 10,
        padding: 15,
        borderRadius: 30,
        alignItems: 'center',
    },
    buttonOutline: {
        backgroundColor: 'white',
        marginTop: 5,
        borderColor: '#212A3E',
        borderWidth: 2,
    },
    buttonOutlineText: {
        color: '#212A3E',
        fontWeight: '700',
        fontSize: 16,
    },
    buttonText: {
        color: 'white',
        fontWeight: '700',
        fontSize: 16,
    },
})
